Na koniec naszego cyklu o odchudzaniu kilka tricków które pozwalają oszukać nasz mózg. Mózg, który najbardziej lubi to co tłuste i słodkie. Tak ukształtowała go ewolucja. 
I tak :  - kupmy nową zastawę stołową. Koniecznie niebieską! Okazuje się, że z niebieskich talerzy zjadamy najmniej;
- I niech te talerze bę∂ą kwadratowe. Z badań naukowców wynika, że potrawa na takim talerzu wydaje nam się bardziej gorzka i zjadamy jej mniej;
- Nie trzymajmy jedzenia  w otwartych pojemnikach. Częściej po nie sięgamy;
- Jogurt przełóżmy do ciężkiej miseczki,  wyda nam się bardziej intensywny w smaku, szybciej nas nasyci; A  miseczka niechaj  będzie elementem całej naszej zastawy, która  właśnie powinna  być ciężka np. kamionkowa. Daje ona wtedy poczucie, że posiłek był bardziej syty, a więc zjemy mniej. Wniosek: Porcelaną zastawę dajemy w prezencie szczupłym przyjaciołom, a sami jedzmy na kamionkowych,  niebieskich, kwadratowych talerzach...

